def collisions(array, rise, run):
    right = 0
    down = 0
    trees = 0
    notrees = 0
    while True:
        if down > len(array) - 1:
            break
        if right > len(array[0]) - 1:
            right = right - len(array[0])
        if array[down][right] == '#':
            trees += 1
        else:
            notrees += 1
        right += run
        down += rise
    print(trees)

